function FAQList() {
    const [active, setActive] = useState('');
    return (
        <div style={{ margin: '0 20px' }}>
            <div>
                <h3>Частые вопросы</h3>
            </div>
            <ul className="FAQ-list" >
                <li><Link className="FAQ-list-item" to='/FAQ/'>Открыт ли монастырь для посещений?</Link></li>
                <li><Link className="FAQ-list-item" to='/FAQ/'>Как добраться до монастыря?</Link></li>
                <li><Link className="FAQ-list-item" to='/FAQ#question-3'>Работает ли трапезная?</Link></li>
                <li><Link className="FAQ-list-item" to='/FAQ#question-4'>Есть ли безналичный расчет?</Link></li>
                <li><Link className="FAQ-list-item" to='/FAQ#question-5'>Проводится ли у нас таинство крещения?</Link></li>
                <li><Link className="FAQ-list-item" to='/FAQ#question-6'>Как заказать поминовение?</Link></li>
                <li><Link className="FAQ-list-item" to='/FAQ#question-7'>Можно ли переночевать в монастыре?</Link></li>
            </ul>
        </div>
    );
}

export default FAQList;
